import React from 'react';
import '../index.css';
import axios from 'axios';
import Projects from './Projects.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
let match = useRouteMatch();
class Content extends React.Component{
  constructor(props){
    super(props);
    this.state ={
      content:""
    };
    this.getAboutMe = this.getAboutMe.bind(this);
    this.setExample = this.setExample.bind(this);
  }
  setExample(prevProps){
    if(this.props.val!=prevProps.val &&this.props.val=="projects"){
      axios.get(match.url+'/examples/cppchess.html')
  .then((response) => {
    console.log(response.data);
    this.setState({content:response.data})
  });
    }
  }
  setAboutMe(prevProps){
    if(this.props.val!=prevProps.val &&this.props.val=="home"){
      axios.get(process.env.PUBLIC_URL+'/aboutme.html')
  .then((response) => {
    console.log(response.data);
    this.setState({content:response.data})
  });
    }
  }
  getAboutMe(){
    return {__html:this.state.content};
  }
  componentDidMount(){
    axios.get(process.env.PUBLIC_URL+'/aboutme.html').then((response) => {console.log(response.data);
      this.setState({content:response.data})
    });
  }
  componentDidUpdate(prevProps){
    this.setAboutMe(prevProps);
    this.setExample(prevProps);
  }
  render(){
    console.log(process.env.PUBLIC_URL);
      if(this.props.val=='home'){
      return(
        <Router basename={process.env.PUBLIC_URL+"/devFolio"}>
          <div className="site-content">
            <div className="primary">
              <div dangerouslySetInnerHTML={this.getAboutMe()}/>
            </div>
          </div>
          </Router>
        );
      }
      else if(this.props.val=='projects'){
        return(<Projects/>);
      }
      else{
        return(
          <Router basename={process.env.PUBLIC_URL+"/devFolio"}>
            <div className="site-content">
              <div className="primary">
                <div dangerouslySetInnerHTML={this.getAboutMe()}/>
              </div>
            </div>
            </Router>
          );
      }


  }
}


export default Content;
